<head>
    <style>
        /* style placeholder */
/*#######################*/
:root {
    /* define global variables */
    /* official SEG colours*/   
    --primary-blue: rgba(46,149,222,1.0);
    --primary-navy: rgba(10,52,94,1.0);
    --primary-white: rgba(255,255,255,1.0);
    --support-dark-grey: rgba(143,143,143,1.0);
    --support-light-grey: rgba(198,198,198,1.0);
    --support-off-white: rgba(246,241,230,1.0);
    --accent-blue: rgba(17,175,219,1.0);
    --accent-orange: rgba(243,159,33,1.0);
    --accent-coral: rgba(239,112,148,1.0);

    /*additional colours*/
    --blue-ish-grey: rgba(245, 244, 250, 1.0);
    --select-box-grey: rgba(227, 227, 227, 1.0);
    --selected-blue: rgba(203, 230, 246, 1.0);
    --text-almost-black: rgba(62, 61, 73, 1.0);
    --bottom-navbar-height: 13vh;
    --very-light-grey: rgba(240,240,240,1.0);
    --results-green-dark: rgba(60,179,113,1.0);
    --results-green-light: rgba(152,251,152,1.0);
    --results-red-dark: rgba(220,20,60,1.0);
    --results-red-light: rgba(239,200,200,1.0);
    --results-blue-dark: rgba(46,149,222,1.0);
    --results-blue-light: rgba(240,248,255,1.0);
}

.global-wrapper p {
    max-width: 70%;
    color: var(--primary-navy);
}

.sub-wrapper p {
    margin-top: 5px;
}

.bottom-navbar {
    float: bottom;
    position: relative;
    height: var(--bottom-navbar-height);
    z-index: 1;
    margin-top: 5vw;
    border-top: 2px solid var(--select-box-grey);
}

.bottom-navbar .prev-button {
    float: left;
    position: relative;
    left: 1%;
    top: 5%;
    cursor: pointer;
}

.bottom-navbar .next-button {
    float: right;
    position: relative;
    right: 1%;
    top: 5%;
    margin-left: 1%;
    cursor: pointer;
}

.bottom-navbar .cancel-button {
    position: absolute;
    top: 5%;
    left: 50%;
    transform: translateX(-50%);
    cursor: pointer;
    background: none;
    border: 2px solid var(--primary-blue) !important;
    color: var(--primary-blue);

}

.bottom-navbar .filter-progress {
    float: right;
    position: relative;
    right: 1%;
    margin-left: 1%;
    text-align: center;
}

.top-headbar {
    border-bottom: 2px solid var(--select-box-grey);
    width: 70%;
    margin-bottom: 1%;
    padding-bottom: 1%;
}

.free-text-input {
    width: 60%;
}

.free-text-input-error {
    width: 60%;
    border-color: red;
    color: red;
}

.free-text-input-error::placeholder{
    color: red;
}

.file-input-container {
    display: flex;
    align-items: center;
    width: 100%;
}

.file-name-display {
    padding-left: 10px;
}

.mail-date-time {
    width: 20%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 5px;
}

.csv-example {
    border-collapse: collapse;
    margin-top: 5px;
    margin-bottom: 5px;
}

.csv-example, th, td {
    border: 2px solid var(--support-light-grey);
    text-align: left;
    padding: 5px;
}

.html-preview {
    border: 2px solid var(--support-light-grey);
    margin-top: 5px;
    margin-bottom: 5px;
}

.csv-preview {
    border: 2px solid var(--support-light-grey);
    border-collapse: collapse;
    margin-top: 5px;
    margin-bottom: 5px;
}

.csv-preview, th, td {
    border: 2px solid var(--support-light-grey);
    text-align: left;
    padding: 5px;
}

.confirm-summary strong{
    display: inline;
    margin-top: 10px;
    margin-bottom: 10px;
}

.confirm-summary p{
    display: inline;
    margin-top: 10px;
    margin-bottom: 10px;
}
/*#########################################################################################*/

/* Styling for the popup */
.popup {
    display: none;
    max-width: 500px;
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    padding: 30px;
    background-color: white;
    border: 1px solid #ccc;
    box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.3);
    z-index: 1000;
}

.close-button {
    position: absolute;
    top: 10px;
    right: 10px;
    background-color: transparent;
    border: none;
    cursor: pointer;
}

.overlay {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 900;
}

.button-container {
    display: flex; /* Use flex display to make the buttons sit next to each other */
    justify-content: space-between; /* Space them evenly within the container */
}


.input-container {
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 5px;
}

label {
    display: block;
    margin-bottom: 5px;
}

input[type="number"],
input[type="checkbox"] {
    padding: 5px;
    border: 1px solid #ccc;
    border-radius: 4px;
}

input[type="text"],
input[type="email"],
input[type="password"] {
    padding: 5px;
    margin-bottom: 5px;
    margin-top: 5px;
    border: 1px solid #ccc;
    border-radius: 4px;
}

/*loader styling*/
.loader {
    margin: auto;
    border: 16px solid #f3f3f3; /* Light grey */
    border-top: 16px solid #2e95de; /* Blue */
    border-radius: 50%;
    width: 100px;
    height: 100px;
    animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}

/*user warning*/
.userWarning {
    display: none;
    color: red;
}

/*small line breaks*/
.brsmall {
    display: block;
    margin-bottom: -.2em;
}
  
.brxsmall {
    display: block;
    margin-bottom: -.4em;
}
